import React from 'react';
import './Login.css';

export default function Login(){
    return(
            <div className="bg-img">
                
                <form className='container' >
                    <div className='sign'>
                    <h1>Login</h1>
                    <label for="email"><b>Email</b></label>
                    <input className='focused' type="text" placeholder="Enter Email" name="email" required />
                    <label for="psw"><b>Password</b></label>
                    <input className='focused' type="password" placeholder="Enter Password" name="psw" required />
                    <button type="submit" className="btn">Login</button>
                    </div>
                </form>
            </div>
    )
}
